import { styled } from "styled-components";

export const StyledHeader = styled.div`
  width: 100vw !important;
  padding: 0;
  margin: 0;
  position: absolute;
  top: 0;

  .logo {
    font-weight: 700 !important;
    letter-spacing: 5%;
  }
  .tabs{
    width: 60%;
  }

  #darkModeIcon{
    cursor: pointer;
  }

  #lightModeIcon{
    cursor: pointer;
    display: none;
  }
`;

export const StyledNav = styled.h4`

`;
